package rosalind

import org.scalatest.FunSuite
import rosalind.CORR._
import scala.collection.mutable.Stack
 
class CSTRTestSuite extends FunSuite {

  def switch(gene:List[Char]):List[Int] = 
    gene map (g => if (g == gene.head) 1 else 0)
  
  def isTrivial(character:List[Int]):Boolean = {
  	val c = character.sum
  	c == 0 || c == 1 || c == character.length || c == character.length - 1
  }
  
  def getCharacterTable(genes:List[String]):List[String] =
    (for (c <- genes.transpose; s = switch(c); if (!isTrivial(s))) yield s.mkString).toList
  
  test("character table from genetic strings with data from problem") {
    val data = """ATGCTACC
CGTTTACC
ATTCGACC
AGTCTCCC
CGTCTATC""".split("\r\n").toList
	val characters = getCharacterTable(data)
	expect(2) { characters.length}
    assert( characters.contains("10110"))
    assert( characters.contains("10100"))
  }
  
